import React from 'react';
import Tilt from 'react-tilt';
import './pict.css';
import face from './face.png'

const Pict = () => {
	return(
		<div className = 'ma4 mt0'>
			<Tilt className="Tilt" options={{ max : 25 }} style={{ height: 250, width: 250 }} >
 				<img src={face} alt="FaceRecognition"/>
			</Tilt>
		</div>
	);
}

export default Pict;
